import Link from "next/link";

export default () => (
    <header>
        <nav>
            <div>
                <ul>
                    <li>
                        <Link href={"/"}>
                            <a>Home</a>
                        </Link>
                    </li>
                    <li>
                        <Link href={"/about"}>
                            <a>About</a>
                        </Link>
                    </li>
                </ul>
            </div>
        </nav>

        <style jsx>{ //next js 의 스타일을 non global방식으로 그 js파일내에서만 적용이된다. classname이나 id를 따로 설정해줄 필요가 없다.
            `
                ul{
                    display: flex;
                }
                ul li {
                    margin-right: 20px;
                }
                header {
                    background-color: red;
                }
            `
        }</style>

    </header>
);
